typedef struct{double c;double m;double y;double k;}CMYK_Max;typedef struct{double r;double g;double b;}RGB_Max;typedef struct{CMYK_Max cmyk;RGB_Max rgb;}Maximums;typedef struct{int r;int g;int b;}RGB;RGB cmyk_to_rgb(double c,double m,double y,double k,Maximums maximums){RGB rgb;double c_=c/maximums.cmyk.c;double m_=m/maximums.cmyk.m;double y_=y/maximums.cmyk.y;double k_=k/maximums.cmyk.k;if(c_<0||c_>1||m_<0||m_>1||y_<0||y_>1||k_<0||k_>1){rgb.r=-1;rgb.g=-1;rgb.b=-1;return rgb;}double r_=(1-c_)*(1-k_);double g_=(1-m_)*(1-k_);double b_=(1-y_)*(1-k_);int r=round(maximums.rgb.r*r_);int g=round(maximums.rgb.g*g_);int b=round(maximums.rgb.b*b_);rgb.r=r;rgb.g=g;rgb.b=b;return rgb;}